こんな方におすすめです <br>・ハツラツと過ごしたい <br>・お酒をよく飲む <br>・美容を心がけている <br>・年齢を感じ始めた <br>・年中元気でいたい<br><BR><BR><div align='center'><IMG src='https://image.rakuten.co.jp/dietshop/cabinet/152/2667.jpg'><BR></div><BR><br>「乳酸菌生産物質」は乳酸菌が発酵することで分泌されるエキスです。<br>世界各国から選びぬかれた乳酸菌25種から独自の製法で抽出したエキスを20倍まで濃縮！更に1年間熟成させました。<br>毎日のスッキリ感や健康維持にお役立てください。<br>プラサーダは天然成分100％！添加物を一切使用していないので、 赤ちゃんからご年輩の方にもおすすめです。<br>原材料：脱脂大豆(遺伝子組み換えでない)・乳酸菌・酵母 <br>内容量：380ｍｌ<br>お召し上がり方：栄養補助食品としまして1日数回を目安にコップ一杯のお水に対してスプーン適量約2CCをお召し上がりください。<br>販売元：サンドルフィン<br>

<br>※通常3日～5日前後で配送の予定ですが、人気商品の為、商品欠品の場合、それよりもお時間をいただいたり、商品完売といったご連絡をさせていただくことがございます。ご了承くださいませ。<br><br>区分：健康食品<br><br>広告文責：株式会社ノースウェブ　Tel 0144-52-0018<br><div id="migi-obi">

